// TransitionWrapper.js
import React from 'react';
import { CSSTransition } from 'react-transition-group';
import '../styles/TransitionWrapper.css';

function TransitionWrapper({ children }) {
  return (
    <CSSTransition 
      in={true}
      appear={true}
      timeout={300}
      classNames="fade"
    >
      <div>
        {children}
      </div>
    </CSSTransition>
  );
}

export default TransitionWrapper;
